import React, { useState } from 'react';
import styled from 'styled-components';

// Styling for the form elements
const FormContainer = styled.div`
  display: flex;
  justify-content: space-between;
  padding: 2rem;
  background-color: #111;
  color: #fff;
  min-height: 100vh;
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 50%;
`;

const Input = styled.input`
  background-color: #222;
  color: #fff;
  border: none;
  padding: 0.8rem;
  margin: 0.5rem 0;
  border-radius: 5px;
  outline: none;
`;

const TextArea = styled.textarea`
  background-color: #222;
  color: #fff;
  border: none;
  padding: 0.8rem;
  margin: 0.5rem 0;
  border-radius: 5px;
  outline: none;
  resize: none;
`;

const Select = styled.select`
  background-color: #222;
  color: #fff;
  border: none;
  padding: 0.8rem;
  margin: 0.5rem 0;
  border-radius: 5px;
  outline: none;
`;

const Button = styled.button`
  background-color: #00bfa5;
  color: #fff;
  border: none;
  padding: 1rem;
  margin: 1rem 0;
  border-radius: 5px;
  cursor: pointer;
  font-size: 1rem;
`;

const InfoSection = styled.div`
  width: 45%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  font-size: 1.2rem;
`;

// backend/models/ContactForm.js

const mongoose = require('mongoose');

const ContactFormSchema = new mongoose.Schema({
   topic: {
      type: String,
      required: true
   },
   name: {
      type: String,
      required: true
   },
   email: {
      type: String,
      required: true
   },
   message: {
      type: String,
      required: true
   },
   date: {
      type: Date,
      default: Date.now
   }
});

const ContactForm = mongoose.model('ContactForm', ContactFormSchema);

module.exports = ContactForm;


const ContactUs = () => {
  const [formData, setFormData] = useState({
    topic: '',
    name: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form data submitted: ', formData);
    // Here you can add form submission logic like sending data to your server
  };

  return (
    <FormContainer>
      <InfoSection>
        <h1>Contact Us, We're Ready to Help!</h1>
        <p>We strive to provide you with the best experience and the best platform to find your choice. Post us any queries and we’ll get back to you.</p>
        <p><b>Chat with us:</b> <br/> to_let@gmail.com</p>
        <p><b>Call us:</b> +91 9876543210</p>
      </InfoSection>

      <Form onSubmit={handleSubmit}>
        <label htmlFor="topic">Topic</label>
        <Select id="topic" name="topic" value={formData.topic} onChange={handleChange}>
          <option value="">Select a topic</option>
          <option value="general">General Inquiry</option>
          <option value="support">Support</option>
          <option value="sales">Sales</option>
        </Select>

        <label htmlFor="name">Name</label>
        <Input
          id="name"
          type="text"
          name="name"
          placeholder="Your name"
          value={formData.name}
          onChange={handleChange}
        />

        <label htmlFor="email">Email</label>
        <Input
          id="email"
          type="email"
          name="email"
          placeholder="Your email"
          value={formData.email}
          onChange={handleChange}
          required
        />

        <label htmlFor="message">Message</label>
        <TextArea
          id="message"
          name="message"
          placeholder="Your message"
          rows="5"
          value={formData.message}
          onChange={handleChange}
          required
        />

        <Button type="submit">Submit Query</Button>
      </Form>
    </FormContainer>
  );
};

export default ContactUs;
